import React from "react";
import s from "./Layout.module.css";

const Layout = (props) => {
  return (
    <section className={s.root} id={props.id}>
      <div
        class="wrapper"
        style={
          props.colorBg
            ? { backgroundColor: props.colorBg }
            : {
                backgroundImage: props.urlBg,
              }
        }
      >
        <article>
          <div class={s.title}>
            <h3>{props.title}</h3>
            <span class={s.separator}></span>
          </div>
          <div class={s.desc && s.full}>
            <p>{props.desc}</p>
          </div>
        </article>
      </div>
    </section>
  );
};

export default Layout;
